import * as actionTypes from "../lib/constants/actionTypes";
const postRate = data => (
  {
  type: actionTypes.RATE_PRODUCT,
  payload: data
});

export default function getProductRate(userData1) {
    ////console.log('in action call');
  return function(dispatch) {
    return axios.post(BASE_URL+'updateProductRatingByCustomer',userData1)
      .then(({ data }) => {
        alert(data.message);
      dispatch(postRate(data));
    })
